import React from 'react';
import './RoomsPage.css'; // Include the CSS file you just created
import groupsIcon from '../assets/groups.png';

const RoomsPage = () => {
  const rooms = [
    { id: 1, name: 'Room 1', icon: 'groupsIcon' },
    { id: 2, name: 'Room 2', icon: 'groupsIcon' },
    { id: 3, name: 'Room 3', icon: 'path_to_icon_3' },
  ];

  return (
    <div className="rooms-page">
      <h1>Available Groups To Join!</h1>
      <ul className="rooms-list">
        {rooms.map(room => (
          <li key={room.id} className="room-item">
            <img src={room.icon} alt={room.name} className="room-icon" />
            <span>{room.name}</span>
          </li>
        ))}
      </ul>
      <button className="proceed-button">Select And Proceed</button>
    </div>
  );
};

export default RoomsPage;
